import React, { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Container , Row, Col ,Navbar, Nav, Image  } from 'react-bootstrap';
import OffCanvasExample from '../Offcanvas/OffCanvasExample';
import classes from './Navbar.module.css';

import chart from "../../assets/chart.svg";



const NavbarCustom = () => {
    return (
        <div>
            <Navbar bg="primary" variant="dark" className={classes.nav}>
                <Container>
                    <Navbar.Brand href="#home" >Navbar</Navbar.Brand>
                    <Nav className="me-auto">
                        <Nav.Link href="#home" className={classes.nav_links}>Home</Nav.Link>
                        <Nav.Link href="#home" className={classes.nav_links}>Home</Nav.Link>
                        <Nav.Link href="#home" className={classes.nav_links}><OffCanvasExample/></Nav.Link>

                    </Nav>
                </Container>
            </Navbar>


        </div>
    )
}

export default NavbarCustom;
